Inside the only building in existence to assemble a rocket that carried humans to another world. 

This is the Vehicle Assembly Building and it was originally built to assemble the Saturn V rocket that brought the Apollo astronauts to the moon. 

{👉🏼swipe to 2️⃣}
Once assembled, it was placed on NASA’s crawler (the 6+ million pound vehicle you see in the next pic) and moved at <2mph to bring the 🚀 from the Vehicle Assembly Building to the launch pad. 

Look at the sign behind my head in the first pic - that’s the logo for NASA’s Artemis mission. (I’m Greek mythology Artemis is Apollo’s twin sister)

This building is now being used to assemble NASA’s rocket that will bring the first woman and person of color to the moon through NASA’s Artemis mission. 

{👉🏼swipe to 3️⃣}
That rocket is called the Space Launch System and I got to see the core stage! That’s the biggest part of the rocket - the orange piece with the engines in the 3rd pic. 

{👉🏼 swipe to 4️⃣}
Soon they will pick this baby up with a huge crane and place vertically next to its 2 boosters, which you can see in the 4th pic. They’re a bit hidden behind all that metal, but they are the 2 white things standing vertically.

{👉🏼 swipe to 5️⃣}
And finally on top of the core stage, they’ll place the stage adapter (that orange piece) and on top of that will go that white piece. And on top of THAT will go the Orion capsule that carries the astronauts. 👩🏽‍🚀👩🏻‍🚀👨🏿‍🚀

{👉🏼 swipe to 6️⃣}
You can see the artist rendering of what this will ultimately look like put together. This is the vehicle that will send the first woman and person of color to the moon. 🙌🏼🚀🌗

You can watch a lot of this history in real time at the @kennedyspacecenter Visitor Complex. 🙌🏼 if you go, tag me! #kennedySpaceCenter
